    @staticmethod
    def make_im(color: str):
        dat: str = ManaSymbols.coldat[color]['dat']
        datas: list = []
        while dat:
            key: str = dat[0]
            num: str = ''
            for ix in range(1, len(dat)):
                if dat[ix].isdigit():
                    num += dat[ix]
                elif num:
                    break

            datas += [ManaSymbols.coldat[color][key]] * int(num)
            dat = dat[len(key) + len(num):]

        im = Image.new(mode='RGBA', size=(ManaSymbols.w, ManaSymbols.h), color=(0, 0, 0, 0))
        im.putdata(datas)
        ManaSymbols.images[color] = im

    @staticmethod
    def get_im(var: str) -> Image.Image | None:
        im = ManaSymbols.images.get(var, None)
        if not im and var in ManaSymbols.coldat:
            ManaSymbols.make_im(color=var)
            return ManaSymbols.images.get(var, None)
        else:
            return im

    @staticmethod
    def get_pixmap(var: str) -> QtGui.QPixmap | None:
        return ManaSymbols.pixmaps.get(var, None)

    @staticmethod
    def save_pixmap(var: str, pixmap: QtGui.QPixmap):
        ManaSymbols.pixmaps[var]: QtGui.QPixmap = pixmap
